import React from 'react';
import ReactDOM from 'react-dom';
import Home from './home';

class Lic extends React.Component {

  back = () => {

   ReactDOM.render(<Home />, document.getElementById('door'));

  }

   render () {

     return (

         <div id="text">
           <p>lic page of </p>
           <button onClick={this.back} id="back">back</button>
         </div>

     );
   }


}
export default Lic;
